import './AfficherPhysique.css';


function AfficherPhysique() {
  return (
    <div className="phys_body">
        <div className="div_titre">
        <h3 className="titre_boutique">La boutique</h3>
        <h2 className="titre_boutique">Bicraveurs2Bass</h2>
        </div>
    </div>
  );
}

export default AfficherPhysique;
